import { Amplify } from 'aws-amplify';

const amplifyConfig = {
  Auth: {
    Cognito: {
      region: 'us-east-1',
      userPoolId: 'us-east-1_xxxxxxxxx', // 실제 User Pool ID로 변경 필요
      userPoolClientId: 'xxxxxxxxxxxxxxxxxxxxxxxxxx', // 실제 Client ID로 변경 필요
    }
  }
};

Amplify.configure(amplifyConfig);

export default amplifyConfig;
